import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-812a5e5e58c6",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/huangbing/Desktop/docs/docs/README.md").then(comp => {
        Vue.component("v-812a5e5e58c6", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-47291234e1dc1",
    path: "/bar/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/huangbing/Desktop/docs/docs/bar/README.md").then(comp => {
        Vue.component("v-47291234e1dc1", comp.default)
        next()
      })
    }
  },
  {
    path: "/bar/index.html",
    redirect: "/bar/"
  },
  {
    name: "v-31d4b7223c80a",
    path: "/foo/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/huangbing/Desktop/docs/docs/foo/README.md").then(comp => {
        Vue.component("v-31d4b7223c80a", comp.default)
        next()
      })
    }
  },
  {
    path: "/foo/index.html",
    redirect: "/foo/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
